[JimSlip] Kat (Kat Makes a Cacophony! / 03.18.2014)

As members will have heard, during her casting, Kat screamed the house down in crazed sexual abandonment. &quot;God, I'm good&quot; I mused, whilst fretting for the microphones which were being trashed by the din. Lara entered the room wearing ear defenders ( as per Health &amp; Safety directives issued for &quot;Noise in excess of 120 db in a confined spaced&quot;) for her protection. I am informed that this kind of aural hazard is quite common on American porn shoots, during which the combined screaming, shouting and groans of supposed &quot;Ecstasy&quot; can produce the same noise as a jumbo jet engine at full throttle fro...

